import React, { Component } from 'react';
import Navigation from "../components/includes/navigation";
import App from "next/app";

class Index extends Component {
    render() {
        return (
            <App>
                <div>
                    <Navigation/>
                    <h1>به چت روم آویزون خوش آمدید</h1>
                </div>
            </App>
        );
    }
}

export default Index;
